import React from "react";
import Layout from "../components/Layouts/BasicLayout";
import Dog from "svg-react-loader?name=Dog!../../public/404-colored.svg";

const Custom404 = () => {
  return (
    <Layout>
      <h2>Błąd - 404</h2>
      <Dog className="404-svg" />
      <style jsx>
        {`
          @media (min-width: 1024px) {
            h2 {
              text-align: center;
            }
          }
        `}
      </style>
    </Layout>
  );
};

export default Custom404;
